import React from 'react';
import { OnboardingState } from '../../../data/onboardingTypes';

interface WelcomeProps {
  data: OnboardingState;
  update: <K extends keyof OnboardingState>(key: K, value: OnboardingState[K]) => void;
  onNext: () => void;
}

export function Welcome({ data, update, onNext }: WelcomeProps) {
  return (
    <div className="onboarding-step">
      <h1>Welcome to Guidewell</h1>
      <p>We'll use a few quick answers to personalize scenarios. You can change these anytime in Settings.</p>
      <button onClick={onNext}>Get started</button>
    </div>
  );
}
